import "./App.css";

function App() {
  return (
  <main>
    <header>
      <a href="" className="logo">MyBlog</a>
      <nav>
        <a href="">Login</a>
        <a href="">Register</a>
      </nav>
    </header>
      <div className="entry">
        <img src="https://www.loveyourlandscape.org/media/83725/74570.jpg" alt=""></img>
        <h2>When to Start Mowing in the Spring</h2>

      </div>

  </main>
  )
}

export default App;
